import React from 'react';
import { Grommet } from 'grommet';
import  Header from './Header';
const theme = {
	global: {
		colors: {
			brand: '#061533',
			focus: 'transparent'
		},
		font: {
			family: 'Poppins',
			size: '18px'
		}
	}
};

function App() {
	return (
		<Grommet theme={theme}>
			<Header />
			
		</Grommet>
	);
}

export default App;
